function contains(a, obj)
{
	var i = a.length;
	while (i--)
	{
		if (a[i] === obj)
		{
			return true;
		}
	}
	return false;
};

function polarToRect(r , deg, centerX, centerY){
		var degree = deg *(Math.PI/180);
		var x = r * Math.cos(degree);
		var y = r * Math.sin(degree);
		return [Math.trunc(x + centerX),Math.trunc(y + centerY)];
	}

function append_text(g, text, id, x, y, fill_color, scale)
{
	var startX = x;
	var group = d3.select(g)

	for (var i = 0; i < text.length; i++)
	{
		var letter = character_array[text[i]];

		//Appending next svg
		group.append("path")
			.attr("id", id)
			.attr("d", letter)
			.attr("fill", fill_color)
			.attr("stroke-width", 2)
			.attr("pointer-events", "none")
			.attr("transform", "translate(" + startX + "," + y + ")scale("+scale+")");

		//Finding the location to input the next character
		startX += 6*scale;
	}
}

function append_text_w_wrap(g, text, id, x1, x2, y, fill_color, scale)
{
	var currentX = x1;
	var currentY = y;
	var group = d3.select(g)
	var workSpace = x2 - x1;
	var count = 0;
	var currentStr = text;
	var charWidth = 6 * scale;
	var charHeight = 12 * scale;
	var charFit = Math.trunc(workSpace/charWidth);
	while (count < text.length)
	{
		var lastSpaceChar = charFit;
		if (currentStr.length > charFit) //Checks for last Space within workspace
			for (var i = charFit - 1; i >= 0; i--)
			{
				if (currentStr.charAt(i) == ' ')
				{
					lastSpaceChar = i;
					break;
				}
			}
		for (var i = 0; i < lastSpaceChar; i++)
		{
			var letter = character_array[currentStr[i]];
			//Appending next svg
			group.append("path")
			.attr("id", id)
			.attr("d", letter)
			.attr("fill", fill_color)
			.attr("stroke-width", 2)
			.attr("pointer-events", "none")
			.attr("transform", "translate(" + currentX + "," + currentY + ")scale("+scale+")");
			//Finding the X location to input the next character
			currentX += charWidth;
			count++;
		}
		//Resetting X location and finding new Y location
		currentY += charHeight;
		currentX = x1;
		//The +1 is to get rid of the space. Ofc, the space itself is a char, so i'm adding to the count
		currentStr = currentStr.substring(lastSpaceChar+1);
		count++;
	}
	//It returns the Next Y Location if you have futher Strings to input.
	return currentY;
}

function make_spaces(number_of_spaces)
{
	var output = "";
	for (var s = 0; s < number_of_spaces; s++)
	{
		output += " ";
	}
	return output;
}

function copy(text) {

	var input = document.getElementById(text);//Code for if program is being ran on ipad or iphone, goes down to else statement.
	var isiOSDevice = navigator.userAgent.match(/ipad|iphone/i);

	if (isiOSDevice) {

		var editable = input.contentEditable;
		var readOnly = input.readOnly;

		input.contentEditable = true;
		input.readOnly = false;

		var range = document.createRange();
		range.selectNodeContents(input);

		var selection = window.getSelection();
		selection.removeAllRanges();
		selection.addRange(range);

		input.setSelectionRange(0, 999999);
		input.contentEditable = editable;
		input.readOnly = readOnly;

	}
	else
	{
		input.select();
	}
	document.execCommand('copy');
}